import Link from "next/link";
import { Card, CardImg, CardText } from "@bootstrap-styled/v4";

const ResultView = ({ resultName }) => {
  return (
    <>
      <Card>
        <CardImg
          top
          src={`https://robohash.org/${resultName}?set=set4&size=300x300`}
          alt="monster"
        />
        <CardText>{resultName}</CardText>
      </Card>
      <img
        alt="monster"
        src={`https://robohash.org/${resultName}?set=set4&size=300x300`}
      />
      <Link href="/">
        <a>Try Again</a>
      </Link>
    </>
  );
};

const Result = (props) => {
  const { resultName, isCountDown } = props;

  return (
    <>
      {isCountDown ? (
        <ResultView resultName={resultName} />
      ) : (
        <Link href="/">
          <a>Try Again</a>
        </Link>
      )}
    </>
  );
};
export default Result;
